import React from 'react';
import { Button, Typography } from '@mui/material';

function Home() {
  return (
    <div>
      <Typography variant="h1">Welcome to My App</Typography>
      <Button variant="contained" color="primary">
        Click Me
      </Button>
    </div>
  );
}

export default Home;
